(37, 'TR525538354', 23, '146', '2015-02-05 17:04:32', '高国顺,梁一帆,', '2015-02-14', '2015-02-19', '', 15000.00, '为庆祝我司武汉分公司的成立并加强全公司内部人员技术文化交流，深圳分公司经过总部批准后决定组织分公司技术部门全体员工前往武汉分公司参加开业庆典并进行交流学习。食宿及来回机票由公司统一安排，出发时间为2月14日上午10点，回程时间为2月19日下午5点半。机票为南方航空经济舱，入住酒店安排在距离武汉分公司一公里以内的经济型酒店。另外，主管以上级别的同事将在2月16日前往上海参加产品技术研讨会，2月19日自行返程深圳，请知悉。 ', '0'),
(38, 'TR525123593', 23, '146', '2015-02-05 17:07:25', '高国顺,', '2015-02-08', '2015-02-16', '', 3000.00, '新客户“中国移动广东分公司”礼品采购项目由于竞争对手低价介入，出现较大变数。周一需前往其广东总部与王总重新洽谈。', '梁一帆,13823274178,liangyifan@73go.cn'),
(39, 'TR525866159', 23, '142', '2015-02-05 17:08:22', '梁一帆,', '2015-03-09', '2015-03-11', '', 3000.00, '中石化订单货物已全部送达，经其质检人员检测发现该批次货物出现包装大量渗水现象，已向我司多次投诉。已约定于2月14日前往位客户位于东莞的工厂进行售后事故处理，同时约定物流公司事故处理人员一同前往现场进行责任评估。<br>', '高国顺,13264444570,gfs@73go.cn'),
(40, 'TR525774038', 23, '146', '2015-02-05 17:10:17', '高国顺,', '2015-02-14', '2015-02-15', '', 2500.00, '申请2月14日前往北京总部学习新渠道推广方法；                                                          16日前往上海参加基层干部学习研讨会，高铁出行。', '毛宇菲,18682312912,myf@73go.cn'),
(41, 'TR525858523', 23, '142', '2015-02-05 17:11:30', '高国顺,', '2015-02-25', '2015-02-28', '', 20000.00, '由于南京A项目研发人员不足，进度滞后。为能按计划时间完成项目，经副总批准，本人将于3月8日赴南京支援，初步预估一个礼拜可以完成，可能前后会误差一天左右。同时深圳B项目3月15日开始动工，为能及时赶回深圳参加该项目，希望总部能增派一名研发副经理陪同前往南京协助工作。出差行程拟定于3月8日早上9点出发，（时间关系只能预定到春秋航空头等舱，住宿的酒店会选择距南京分公司一公里以内四星级以下的酒店）。以上，请知悉。<br>', '梁一帆,13823274178,liangyifan@73go.cn'),
(42, 'TR525469140', 23, '144', '2015-02-05 17:11:47', '毛宇菲,', '2015-02-19', '2015-02-20', '', 500000.00, '将于10月10日前往天津滨海新区进行市场开发与调研，为期5天。已约7家客户，分别进行新产品的推广及以往旧产品的使用情况意见收集。  10月15日，从天津赴北京接待大客户黄总，申请租用专车及雇用司机，归期未定。以上机票住宿将优先选择经济舱及三星级以下的酒店。                                           申请于11月11日前往深圳市福田国际会展中心参加行业展会，为期5天。展会期间同时已约5家当地的老客户，分别进行新产品的推广及以往旧产品的使用情况意见收集。  11月17日，从深圳赴上海接待大客户绿城地产陈总，申请租用专车及雇用司机，归期未定。以上机票住宿将优先选择经济舱及三星级以下的酒店（酒店价格预估300元/天）。', '梁一帆,13823274178,liangyifan@73go.cn'),
